Verenigde Staten / Frankrijk
Drama / Muziek
105 minuten

geregisseerd door Ethan Coen en Joel Coen
met Oscar Isaac, Carey Mulligan en John Goodman

Inside Llewyn Davis speelt zich af in de folkscene van de New Yorkse hippiewijk Greenwich Village in de jaren zestig. Llewyn Davis (Oscar Isaac) is een ongelukkige singer-songwriter. De film volgt een week in het leven van Llewyn, waarbij hij een kans krijgt om zowel zijn acteer- als zijn gitaartalent te laten zien, in de hoop het te maken in de muziekwereld.



